厳選された黒糖発酵エキスを高濃度配合した、１品で6役の復元タイプの弾力ジェルです。溶け込むようになじみ、うるおいで満ちた弾力のある肌に導きます。<br><br>・１品で6役！<br>　化粧水・乳液・美容液・クリーム・パック・マッサージ効果。<br><br>・黒糖発酵エキスを高濃度配合・Wヒアルロン酸・リピジュア・Wコラーゲン・ボタンピエキス配合<br><br>・弱酸性・無着色・無鉱物油<br><br>・使いやすいワンタッチキャップタイプ。<br><br>・特に乾燥が気になるときは、マッサージやパックとして、たっぷりご使用いただくと効果的です。<br><br>【使用方法】<br>・洗顔のあと、指先にパール粒2～3個くらいの量をとり、あご・両頬・鼻・ひたいの5ヶ所においてから、よくなじませるように肌にムラなくのばします。<br><br>【使用上注意】<br>・ご使用後はキャップをきちんとしめてください。<br>・お肌に異常が生じていないかよく注意して使用してください。<br>・傷やはれもの・湿しん等、お肌に異常のあるときはお使いにならないでください。<br>　使用中、赤味・はれ・かゆみ・刺激、色抜け(白斑等)や黒ずみ等の異常があらわれた場合は、使用を中止し、皮ふ科専門医等へご相談ください。そのまま使用を続けますと症状が悪化することがあります。<br>・高温の場所には置かないでください。<br><br><br><br>【成分】<br>クルイベロミセス/サトウキビ茎汁エキス発酵液、水、エタノール、ジメチコン、グリセリン、BG、PEG-11メチルエーテルジメチコン、(PEG-240/デシルテトラデセス-20/HDI)コポリマー、アスコルビン酸、グリコシルトレハロース、サクシニルアテロコラーゲン、チャ葉エキス、トコフェロール、ヒアルロン酸Na、ボタンエキス、ポリクオタニウム-51、加水分解ヒアルロン酸、水溶性コラーゲン、BHT、EDTA-2Na、PEG-40水添ヒマシ油、PPG-6デシルテトラデセス-20、TEA、(アクリレーツ/アクリル酸アルキル(C10-30))クロスポリマー、(ジメチコン/ビニルジメチコン)クロスポリマー、アブラナ種子油、カルボマー、スクワラン、ポリリシノレイン酸ポリグリセリル-6、モルティエレラ脂肪酸スクロース、ラウリン酸K、ラウロイルグルタミン酸ジ(フィトステリル/オクチルドデシル)、加水分解水添デンプン、エチルパラベン、フェノキシエタノール、メチルパラベン、香料<br><br>【内容量】<br>90g <br><br>（　美容ジェル・オールインワン・時短・多機能・黒糖　）<br><br>〒103-0027 <br>東京都中央区日本橋１－１６－１１ <br>コーセーコスメポート株式会社 <br>お客様相談室 電話番号：03-3277-8551 <br>受付時間：月～金9：00～17：00まで（土、日、祝を除く <br><br>JANコード：4971710385809<br>商品番号：101-28562<br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br>。<br><br><style type="text/css">
